import React from "react";
import "./landing.css";

export default function Landing() {
  return (
    <div className="banner">
      <div className="banner-content">
        <div className="banner-text">
          <h1>WELCOME TO</h1>
          <h1>Rooster Grin</h1>
          <button>Sign Up</button>
        </div>
      </div>
    </div>
  );
}
